local sounds = {};
local speakerindex = 1;
local speakersounds = 1;

-- structure:
--{
--	{i=1, s={[sound], [sound], [sound]}},
--	..
--}
for i, id in ids do
	if id == "" then continue end
	local subsounds = {
		i=1,
		s={},
	};
	
	for x=1,SOUNDS_PER_NOTE do
		--print("index: " .. tostring(speakerindex));
		subsounds.s[x] = speakers[speakerindex]:LoadSound(id);
		subsounds.i = 1;
		speakersounds += 1;
		--print(speakersounds)
		
		if speakersounds >= 10 then
			--print('a')
			speakerindex += 1;
			speakersounds = 1;
		end
	end
	
	sounds[i] = subsounds;
end

function add_one(speakers)
	local index = speakers.i;
	local len = #speakers.s;

	if index + 1 > len then
		speakers.i = 1;
		return;
	end

	speakers.i += 1;
end

function get_sound(midid)
	--print(midid);
	local subsounds = sounds[midid];
	local sound = subsounds.s[subsounds.i];
	add_one(subsounds);
	
	return sound;
end


